import "../Assets/CSS/OneCall.css"
import { useState,useEffect } from "react"

function OneCall(props) {
    const [dest,setDest]=useState("")

    useEffect(() => {
        if(props.dstchannel.includes("203"))
        {
            setDest('Adel')
        }
        else
        {
            setDest('Autre')
        }
    }, [])


    return (
        <div id="OneCall-div">

            {
                props.src==="33411932752" ? 
                <i style={{marginLeft : '2%',fontSize :'1.6em'}}class="fa-solid fa-arrow-trend-up"></i>
                : 
                props.lastdata==="records/SOWILO-TECH-OQP" ? 
                <i class="fa-solid fa-square-xmark" style={{color: '#ff0000',marginLeft : '2%',fontSize :'1.6em'}}></i>         
                : 
                props.lastdata==="records/SOWILO-CLOSED" ? 
                <i class="fa-solid fa-square-xmark" style={{color: '#ff0000',marginLeft : '2%',fontSize :'1.6em'}}></i> 
                :
                <i style={{marginLeft : '2%',fontSize :'1.6em'}}class="fa-solid fa-arrow-trend-down"></i>
            }


            {
                props.src==="33411932752" ? 
                <p style={{marginLeft : '2%',marginRight :'7.7%'}}> {props.channel.split('/')[1].split('-')[0]}</p>                
                : 
                <p style={{marginLeft : '2%',marginRight :'2%'}}> {props.src}</p>             
            }

            <p> ------------------ </p>

            {
                props.src==="33411932752" ? 
                <p style={{marginLeft : '2%',marginRight :'2%'}}> {props.dst}</p>                
                : 
                <p style={{marginLeft : '2%',marginRight :'2%'}}> {dest}</p>             
            }

            {
                props.lastdata==="records/SOWILO-TECH-OQP" ||  props.lastdata==="records/SOWILO-CLOSED" ?
                <p style={{marginLeft : '28%'}}> {props.answerdate} </p>
                :
                <p style={{marginLeft : '15%'}}> {props.answerdate} </p>

            }
            <p style={{marginLeft : '15%'}}> {props.billsec}</p>
            <i style={{marginLeft : '10%',cursor :'pointer'}} class='fas fa-phone'></i>

        </div>
    )
}

export default OneCall
